import React, { Component } from 'react'
import { ListGroup,ListGroupItem } from 'reactstrap'

export default class Category extends Component {
  render() {
    return (
      <ListGroup>
        <ListGroupItem>giyim</ListGroupItem>
        <ListGroupItem>mobilya</ListGroupItem>
        <ListGroupItem>teknolojik</ListGroupItem>
      </ListGroup>
    )
  }
}
